interface IMainReducer {
  test: string;
}

export const InitialMainReducer: IMainReducer = {
  test: '',
};

export const main: (state: IMainReducer, action: string) => IMainReducer = (
  state: IMainReducer = InitialMainReducer,
  action: string,
) => {
  switch (action) {
    case 'SHOW_ALL':
      return { ...InitialMainReducer, test: 'Blabla' };
    case 'SHOW_COMPLETED':
      return InitialMainReducer;
    case 'SHOW_ACTIVE':
      return InitialMainReducer;
    default:
      return InitialMainReducer;
  }
  // return InitialMainReducer;
};
